class Solution {
    public int minimumCost(int[] nums) {
        int n = nums.length;
        int[][] dp = new int[n + 1][4];
        final int MAX = Integer.MAX_VALUE / 2; // To avoid integer overflow

        // Initialize dp array with maximum values
        for (int i = 0; i <= n; i++) {
            for (int j = 0; j < 4; j++) {
                dp[i][j] = MAX;
            }
        }

        dp[0][0] = 0; // Base case: cost of forming 0 subarrays from 0 elements

        // Fill the dp array
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= 3; j++) {
                int sum = 0;
                for (int k = i; k >= j; k--) {
                    sum += nums[k - 1];
                    dp[i][j] = Math.min(dp[i][j], dp[k - 1][j - 1] + nums[k - 1]);
                }
            }
        }

        return dp[n][3]; // Minimum cost of forming 3 subarrays from n elements
    }
}
